import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Power from './components/Power';

const App = () => {
  const data = [
    { currentLoad: 10, capacity: 20 },
    { currentLoad: 15, capacity: 25 },
    { currentLoad: 12, capacity: 22 },
    // Add more data objects as needed
  ];

  return (
    <div className="container">
        <div className="row">
          <div className="col-md-6">
            <Power data={data} />
          </div>
          {/* Add more components or content for the right half of the screen */}
        </div>
      </div>
  );
};

export default App;
